import style from './Tasks.module.css';

const Tasks = () => {
    return (
        <div className={style['wrapper']}>

            <p className={style['title']}>Tasks:</p>

            <div className={style['tasks']}>
   
            </div>

        </div>
    );
}

export default Tasks;
